import React from "react";
import "./TeamSection.css";

const teamMembers = [
  {
    name: "Anand Krishnan",
    role: "Projects and CSR",
  },
  {
    name: "Sujata Satyamadhava",
    role: "Family Services",
  },
  {
    name: "Jyoti Rajappa",
    role: "HR, Finance & Administration",
  },
  {
    name: "Priya Vijayan",
    role: "Academics",
  },
];

const finances = [
  { year: "2022-2023" },
  { year: "2021-2022" },
  { year: "2020-2021" },
];

export default function TeamSection() {
  return (
    <div className="team-container">
      <h1 className="team-title">TEAM</h1>

      <div className="team-inner">
        <div className="team-tabs">
          <div className="team-tab">FOUNDERS</div>
          <div className="team-tab">GOVERNORS</div>
          <div className="team-tab team-tab-active">TEAM</div>
        </div>
        <div className="team-members">
          {teamMembers.map((tm) => (
            <div key={tm.name} className="team-member">
              <div className="team-member-image">
                <span role="img" aria-label="profile" className="profile-img">
                   <div className="logo">
            <img src="/logo22.jpg" alt="Arunodaya Logo" />
          </div>
           <div className="logo">
            <img src="/logo22.jpg" alt="arn.jpg" />
          </div>
                </span>
              </div>
              <div className="team-member-name">{tm.name}</div>
              <div className="team-member-role">{tm.role}</div>
            </div>
          ))}
        </div>
      </div>

      <div className="finances-section">
        <h2 className="finances-title">FINANCES</h2>
        <div className="finances-list">
          {finances.map((f) => (
            <div key={f.year} className="finance-card">
              <div className="finance-year">{f.year}</div>
              <button className="finance-download">&#8681; DOWNLOAD</button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};
